import React, { useContext } from "react";
import { Crt } from "../Context";
import Navbar from "../Navbar/Navbar";
import "./Cart.css";
function Cartpage() {
  const { Cart, setCart } = useContext(Crt);
  return (
    <>
      <div className="main_Nav">
        <Navbar />
      </div>
      <section id="cart" className="section_p1">
        {Cart}
      </section>
    </>
  );
}

export default Cartpage;
